import React, { useState, useEffect } from "react";
import styled from "styled-components";
import { Button } from "react-bootstrap";

const DayBtn = styled(Button)`
  margin-bottom: 20px;
  & + & {
    margin-left: 10px;
  }
`;

function MainDayBtn({
  date,
  hashtag,
  postCnt,
  checkStartTime,
  postGap,
  postRate,
}) {
  return (
    <>
      <DayBtn>최근 1일</DayBtn>
      <DayBtn>최근 7일</DayBtn>
      <DayBtn>최근 30일</DayBtn>
    </>
  );
}

export default MainDayBtn;
